description:
Мой налог – приложение самозанятых, обеспечивающее взаимодействие с налоговыми органами при применении специального налогового режима «Налог на профессиональный доход».
Доход самозанятого облагается по ставкам: 4% в отношении доходов, полученных от физических лиц, и 6% в отношении доходов, полученных от юридических лиц и ИП.
Приложение позволяет самозанятым:
-встать на учет  в  качестве налогоплательщика  налога  на профессиональный доход;
-формировать чеки, не используя контрольно-кассовую технику;
-отправлять чеки покупателям;
-уплачивать налог на профессиональный доход;
-отслеживать статистику по доходам;
-получать справки о постановке на учет и о доходах;
-сняться с учета.

Manage the sales using your phone with the Ozon Seller app. We're adding new functions and tools from the seller account to let Ozon partners manage their sales, respond quickly to changes at the marketplace and solve business tasks away from the computer in just a couple of clicks.

Using the app, you can: 
- register new stores: we'll show how to set everything up from creating a store to the first sale;
- receive notifications about new reviews and questions, orders and returns, Ozon news and app updates;
- create and edit PDPs;
- manage orders: confirm packaging and shipping orders, process returns, track information about your warehouses and supplies to the Ozon warehouses;
- communicate with customers and Ozon support in personal chats, answer questions, reply to reviews and discount requests;
- check the detailed sales, competitors and finance analytics; 
- promote your business: participate in promotions, set up advertising campaigns, set the most attractive prices for your products;
- manage your accounts and finances in Ozon Bank;
- work with several stores;
- get the latest news about the marketplace.
